import React, { useState, useEffect } from "react";
import api from "../utils/axios";
import Table from "../components/Table";
import Button from "../components/Button";
import styles from "./styles/OrganisationsPage.module.css";

function OrganisationsPage() {
  const [organisations, setOrganisations] = useState([]);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchOrganisations = async () => {
      try {
        setLoading(true);
        const response = await api.get("/api/organisations", {
          params: { tenantId: "tenantid1" }
        });
        setOrganisations(response.data);
        setError(null);
      } catch (error) {
        console.error("Error fetching organisations:", error);
        setError("Failed to fetch organisations");
      } finally {
        setLoading(false);
      }
    };

    fetchOrganisations();
  }, []);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <div className={styles.container}>
      <h1>Organisations</h1>
      <Button onClick={() => console.log("Create clicked")}>
        Create New Organisation
      </Button>
      <Table data={organisations} />
    </div>
  );
}

export default OrganisationsPage;
